import React from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import Header from './Components/Header';
import Index from './Components/Index';
import About from './Components/About';
import Section from './Components/Services';
import Pricing from './Components/Pricing';
import Stats from './Components/Stats';
import Contact from './Components/Contact';
import Portfolio from './Components/Portfolio';
import AddToCart from './Components/AddToCart';
import Signup from './Components/Signup';
import Login from './Components/Login';
import Success from './Components/Success';
import Cancel from './Components/Cancel';
import Admin from './Components/AdminPanel';
import Hero from './Components/Hero';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Signup />} />
        <ProtectedRoute path="/dashboard" element={<Hero />} />
        <ProtectedRoute path="/about" element={<About />} />
        <ProtectedRoute path="/section" element={<Section />} />
        <ProtectedRoute path="/portfolio" element={<Portfolio />} />
        <ProtectedRoute path="/stats" element={<Stats />} />
        <ProtectedRoute path="/pricing" element={<Pricing />} />
        <ProtectedRoute path="/contact" element={<Contact />} />
        <ProtectedRoute path="/addToCart" element={<AddToCart />} />
        <Route path="/login" element={<Login />} />
        <Route path="/success" element={<Success />} />
        <Route path="/cancel" element={<Cancel />} />
        <Route path="/admin-panel" element={<Admin />} />
        <Route path="*" element={<Navigate to="/login" />} />
      </Routes>
    </BrowserRouter>
  );
}

const ProtectedRoute = ({ element, path }) => {
  const isAuthenticated = sessionStorage.getItem("token");

  if (path !== "/login" && !isAuthenticated) {
    alert("Please login first.");
    return <Navigate to="/login" />;
  }

  return element;
};

export default App;
